import './App.css';

import { Navbar, Header, Project } from './components';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function App() {
  return (
      <div className="App">
        <Navbar></Navbar>
        <Header></Header>
        <hr></hr>
        <Routes>
          <Route path="/projects">
            <Project></Project>
          </Route>
        </Routes>
      </div>
  );
}

export default App;
